import "./afterSearch.scss";
import loqo from "../assets/loqob.png";
import times from "../assets/cancel.png";
import { NavLink, withRouter } from "react-router-dom";
import $ from "jquery";
import { connect } from "react-redux";


function afterSearch ({ search = [] }) {
  return (
    
    <div id="up" className="afterSearch">
    <div className="title">Axtarisa uygun neticeler</div>
    {
     search.map((search1) => {
      return(
      <>
      <NavLink to="#Section5"> <h1> {search1.title} </h1></NavLink>
      <h1> {search1.length} </h1>

      </>

      )
     })
    }

     
    </div>
  );
  
}
const mapStateToProps = (state, ownProps) => {
console.log("afters" + state.search)
  return {
    search: state.search
  };
};

export default connect(mapStateToProps)(afterSearch);
